	onEachFeature: function(feature,layer) {layer.bindPopup(feature.properties.Miejscow);
	}
});
var start_meta_sw_layer = L.geoJSON(start_meta_sw,{
	pointToLayer: function(feature,latlng){
		return L.marker(latlng,{icon: start_meta_os_icon});
	},
	onEachFeature: function(feature,layer) {layer.bindPopup(feature.properties.nazwa);
	}
});

var trasa_II_layer =  L.geoJSON(trasa_II,{opacity:1, weight: 2, color:'#cc5500'});
var os_II_layer = L.geoJSON(os_II,{style: {opacity:1, weight:3, color:'#dd0000'}, onEachFeature: function (feature, layer) { layer.bindPopup(feature.properties.nr_odcinka)
	}
});


var sw_layer = L.geoJSON(sw,{style: {opacity:1, weight:3, color:'#dd0000'}, onEachFeature: function (feature, layer) { layer.bindPopup(feature.properties.nr_odcinka)
	}
});




//Tworzenie panelu kontroli warstw
var basemap = {
	"Open Street Map" : osm
};

var overlayMaps = {
	"Start i meta całego rajdu" : start_meta_layer,
	"PKC - etap I" : PKC_I_layer,
	"Drogi dojazdowe - etap I" : trasa_I_layer,
	"Odcinki specjalne - etap I" : os1_layer,
	"Start i meta na odcinkach specjalnych - etap I" : start_meta_I_layer,
	"Punkty kontroli przejazdu - etap I" : PKP_I_layer,
	"PKC - etap II" : PKC_II_layer,
	"Start i meta odcinków specjalnych - etap II" : start_meta_II_layer,
	"Start i meta odcinka specjalnego - start wspólny" : start_meta_sw_layer,
	"Drogi dojazdowe - II etap" : trasa_II_layer,
	"Odcinki specjalne - II etap" : os_II_layer,
	"Odcinek specjalny - start wspólny" : sw_layer
};


var layerControl = L.control.layers(basemap,overlayMaps).addTo(podklad);

//dodanie legendy 
var legend = L.control({ position: 'bottomright' });

legend.onAdd = function (map) {
    var div = L.DomUtil.create('div', 'leaflet-control legend');
    
    // Dodanie tytułu legendy
    div.innerHTML += '<div class="legend-title">Legenda</div>';
    
    // Przykładowe elementy legendy
    var items = [
		{ icon: 'start_meta1_sygnatura.svg', label: 'Start i meta całego rajdu', isIcon: true },
		{ icon: 'start_meta_sygnatura.svg', label: 'Start i meta odcinków specjalnych', isIcon: true },
		{ icon: 'pkc_sygnatura.svg', label: 'Punkt kontroli czasu', isIcon: true },
		{ icon: 'pkp_sygnatura.svg', label: 'Punkt kontroli przejazdu', isIcon: true },
        { color: '#cc5500', label: 'Drogi dojazdowe', isIcon: false, isLine: true },
        { color: '#dd0000', label: 'Odcinki specjalne', isIcon: false, isLine: true },
    ];

    // Dodanie elementów legendy
    items.forEach(function (item) {
        if (item.isIcon) {
            div.innerHTML +=
                '<div class="legend-item">' +
                    '<img src="' + item.icon + '" class="legend-icon" />' +
                    '<div class="legend-label">' + item.label + '</div>' +
                '</div>';
        } else if (item.isLine) {
            div.innerHTML +=
                '<div class="legend-item">' +
                    '<div class="legend-line" style="background-color: ' + item.color + ';"></div>' +
                    '<div class="legend-label">' + item.label + '</div>' +
                '</div>';
        } else {
            div.innerHTML +=
                '<div class="legend-item">' +
                    '<div class="legend-color" style="background-color:' + item.color + ';"></div>' +
                    '<div class="legend-label">' + item.label + '</div>' +
                '</div>';
        }
    });

    return div;
};

legend.addTo(podklad);

L.control.scale({
    position: 'bottomright', 
    imperial: false, 
    metric: true 
    }).addTo(podklad);

</script>
</div>
